import React from 'react';
import styles from './Header.module.css';

function Header() {
    return (
        <header className={styles.header}>
        <div className={styles.logo}>
            <img src="Frontend\myapp\public\iconoir_send.png" alt="AI Planet Logo" className={styles.logoImg} />
            <span className={styles.logoText}>planet</span>
            <span className={styles.logoSubText}>formerly DPhi</span>
        </div>
        <button className={styles.uploadButton}>
            <span className={styles.plusSign}>+</span> Upload PDF
        </button>
        </header>
    );
    }

export default Header;
